players.forEach(player => {
    // Calculate the sum of 'apps', 'won', 'draw', etc. properties using reduce
    const totalApps = player.monthlyData.reduce((sum, month) => sum + month.apps, 0);
    const totalWon = player.monthlyData.reduce((sum, month) => sum + month.won, 0);
    const totalDraw = player.monthlyData.reduce((sum, month) => sum + month.draw, 0);
    const totalGoals = player.monthlyData.reduce((sum, month) => sum + month.goals, 0);
    const totalOwnGoals = player.monthlyData.reduce((sum, month) => sum + month.owngoals, 0)
    const totalSlingers = player.monthlyData.reduce((sum, month) => sum + month.slingers, 0);
    const totalAssists = player.monthlyData.reduce((sum, month) => sum + month.assists, 0);
    const totalPenalties = player.monthlyData.reduce((sum, month) => sum + month.penalties, 0);
    const totalHattricks = player.monthlyData.reduce((sum, month) => sum + month.hattricks, 0);
    const totalYellow = player.monthlyData.reduce((sum, month) => sum + month.yellow, 0);
    const totalRed = player.monthlyData.reduce((sum, month) => sum + month.red, 0);
    const totalCleanSheets = player.monthlyData.reduce((sum, month) => sum + month.clean_sheets, 0);
    const totalMOTM = player.monthlyData.reduce((sum, month) => sum + month.motm, 0);
    const totalWinPercentage = ((totalWon / totalApps) * 100).toFixed(2) + ` %`
    const totalUnbeatenPercentage = ((totalWon + totalDraw) / totalApps * 100).toFixed(2) + ` %`

    // Assign the calculated values to overallData properties
    player.monthlyData[0].apps = totalApps;
    player.monthlyData[0].won = totalWon;
    player.monthlyData[0].draw = totalDraw;
    player.monthlyData[0].goals = totalGoals;
    player.monthlyData[0].owngoals = totalOwnGoals;
    player.monthlyData[0].slingers = totalSlingers;
    player.monthlyData[0].assists = totalAssists;
    player.monthlyData[0].penalties = totalPenalties;
    player.monthlyData[0].hattricks = totalHattricks;
    player.monthlyData[0].yellow = totalYellow;
    player.monthlyData[0].red = totalRed;
    player.monthlyData[0].clean_sheets = totalCleanSheets;
    player.monthlyData[0].motm = totalMOTM;
    player.monthlyData[0].win_percentage = totalWinPercentage;
    player.monthlyData[0].unbeaten_percentage = totalUnbeatenPercentage;


    player.monthlyData.forEach(month => {
        const totalWinPercentage = ((month.won / month.apps) * 100).toFixed(2) + ` %`;
        const totalUnbeatenPercentage = ((month.won + month.draw) / month.apps * 100).toFixed(2) + ` %`;

        month.win_percentage = totalWinPercentage;
        month.unbeaten_percentage = totalUnbeatenPercentage;
    });
});


